import React from 'react';

const Header = ({ title = 'المهام' }) => {
  return (
    <header className="sticky top-0 z-30 bg-gray-50">
      <div className="px-4 py-4 sm:px-6">
        <h1 className="text-xl font-medium text-gray-800">
          {title}
        </h1>
      </div>
    </header>
  );
};

export default Header;
